import React from 'react';
import ReactDOM from 'react-dom';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import '../node_modules/bootstrap/dist/css/bootstrap.min.css';
import 'bootstrap/dist/js/bootstrap.bundle.js';
import './css/dashboard.css';
import './css/appointment.css';
import './css/pharmacy.css';
import {AllAppointments} from './App'
import {Navbar} from './App'
import {Doctorsection} from './App';
import {Pharmacy} from './App';
import {Saleorders,Stockinfo,Purchase} from './pharmacypages';

function Connectapp(){
  return( 
    <Router>
    <Navbar/>
    <Routes>
      <Route path='/' element={<Doctorsection/>}/>
      <Route path='/Appointments' element={<AllAppointments/>}/>
      <Route path='/Pharmacy' element={<Pharmacy/>}>
      <Route path='/Pharmacy/Sale_orders' element={<Saleorders/>}/>
      <Route path='/Pharmacy/Stock_Info' element={<Stockinfo/>}/>
      <Route path='/Pharmacy/Purchase' element={<Purchase/>}/>
      </Route>

    </Routes>
  </Router>


  );
}
 ReactDOM.render(<Connectapp /> , document.getElementById("root"));
